const Contacts = () => {
  return (
    <div>
      <h2>Contact Information</h2>
      <p>Telefon nömrəsi: 123-456-7890</p>
      <p>Email: gulnar.eliyeva.2003@gmail.com</p>
    </div>
  );
};

export default Contacts;
